import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container } from "react-bootstrap";
import Hero from "./components/hero";
import Navbar from "./components/navbar";
import Whatwedo from "./components/whatwedo";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Hero />
      <Whatwedo />
    </div>
  );
}

export default App;
